// SPDX-License-Identifier: GPL-3.0

pragma solidity  >=0.5.0 <0.8.0;

/* 
is is use for intract with the contract that are already deployed on the blockchain.iske liye deployed 
contract ka address use karte hai.


Interface is an agreement or a contract between itself and any other contract that implements it.
Cannot be declare state variables, constructor but some data type we can declare like enum, struct
interface have only function but not implemented. all declare functon must be external. 
they can only inherit from other interface but not from other contract.

*/

// contract ke sthan par interface Likhate hai.and Interface name ka first letter Capital lena hai. 
interface IA{
    // state variable data type can not be use. but enum and struct can be use.
    function funA() external;
    function FunB() external pure returns( string memory);
}

contract Accessinterface{

function Callfunction() public returns( string memory) {
// IA(0x358AA13c52544ECCEF6B0ADD0f801012ADAD5eE3).funA();
return IA(0x358AA13c52544ECCEF6B0ADD0f801012ADAD5eE3).FunB();

}
// function checkfunction() view returns

}

